// src/components/Skills.js
import React from 'react';
import '../styles/Skills.css';

// Image and certificate URLs for the skills
const skillDetails = {
  html: {
    img: 'https://tse3.mm.bing.net/th?id=OIP.TrNwUpl6jCYEcKXm-f-b5gHaHa&pid=Api&P=0&h=180',
    certificate: 'https://certificates.ccbp.in/intensive/static-website?id=AEYONEDJIS',
  },
  css: {
    img: 'https://tse3.mm.bing.net/th?id=OIP.TrNwUpl6jCYEcKXm-f-b5gHaHa&pid=Api&P=0&h=180',
    certificate: 'https://example.com/css-certificate',
  },
  // Add similar objects for other skills...
};

const Skills = () => {
  return (
    <section id="skills" className="skills-section">
      <div className="skills-container">
        <h2>Skills</h2>
        <ul className="skills-list">
          {Object.entries(skillDetails).map(([skill, details]) => (
            <li key={skill}>
              <div className="skill-item">
                <img src={details.img} alt={skill} />
                <h5>{skill.toUpperCase()}</h5>
                <a href={details.certificate} className="certificate-link">
                  View Certificate
                </a>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </section>
  );
};

export default Skills;
